&quot;Jiro's courage wilted when he beheld the advancing <i >nobori</i>: red, silent, and thick as reeds.&quot;
<i >--Qie Zi, <b >The Art of Seej</b></i>
This is a feudal Japanese battle flag for Seej. The mortise on the base is offset slightly to accommodate the lopsided weight of the hanging standard.
